    componentDidMount(){
        this.props.getItems()
    }
    render(){
    return(
        <div>
            <button type='button' onClick={() => getItems()}>GET THE FUCKING TECH</button>
               {this.props.tech.map((i) => {
                  return <h2>{i.name}</h2>
               })}
        </div>

    )
    }
}

const mapStateToProps = (state) => {
    return({
      ...state,
      tech: state.tech,

    })
  }

  export default connect(mapStateToProps, {getItems})(Tech);
